INSERT INTO `settings` (`SettingsId`, `InstituteName`, `InstituteSlogan`, `InstituteEstablished`, `InstituteEIIN`, `InstituteIsMPO`, `InstituteLogo`, `InstituteHeader`, `InstitutePhone`, `InstituteEmail`, `InstituteAddress`, `InstituteWebsite`, `InstituteKeywords`, `InstituteTime`, `InstituteGoogleMaps`, `ShortInformation`, `AdminName`, `AdminPhone`, `AdminEmail`, `AdminPhoto`, `AdminSign`, `AdminMessage`, `AdminMessagePhoto`, `SelectedTheme`, `InstituteName_en`, `InstituteEIIN_en`, `InstituteAddress_en`) VALUES
(1, 'গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয়', 'শিক্ষা জাতির মেরুদন্ড', '১৯৬৮ খ্রিঃ', '১১৪১২৯', '', 'Logo.png', '', '01718043634', 'gouragi.ekashi.o.high.school@gmail.com', '  গ্রাম : একাশী , উপজেলা : ঘাটাইল , জেলা : টাঙ্গাইল', 'http://www.geohs.edu.bd', 'গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয়', 'সকাল ৯:৩০ থেকে বিকাল ৪:৩০', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'প্রতিষ্ঠানটি টাঙ্গাইল জেলার ঘাটাইল উপজেলাধীন ৫নং আনেহলা ইউনিয়নের একাশী মৌজায় এলাকার প্রয়োজনে অবস্থিত।', 'মোহাম্মদ নুরুজ্জামান', '০১৭১৮০৪৩৬৩৪', 'gourangi.ekashi.o.high.school@gmail.com', 'Md_norozzam.jpg', 'aa1.jpg', 'টাঙ্গাইল  জেলার ঘাটাইল  উপজেলার  অন্ত্রগত গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয়টি নিরেট অজপাড়াগাঁয়ে অবস্থিত একটি ঐতিহ্যবাহী বিদ্যালয়।তদানীন্তন শিক্ষা বিবর্জিত এলাকায় শিক্ষা বিস্তারের প্রয়োজনে এলাকায় কতিপয় সচেতন মানুষের চেষ্টায় ফসল এই বিদ্যালয় । ১৯৬৮ সালে প্রতিষ্ঠিত হয়ে অদ্যাবদি ছড়িয়ে যাচ্ছে বিদ্যার আলো। বর্তমান যুগ আধুনিক সভ্যতার যুগ , তথা কম্পিউটার যুগ। আধুনিক সভ্যতার  সাথে তাল মিলিয়ে কম্পিউটারের ব্যবহার চলছে এ বিদ্যালইয়েও। অতীত ঐতিহ্যকে ধারন করে , নুতুন সভ্যতার অংশ ছড়িয়ে ডিজিটাল বাংলাদেশ ‘ তথা স্বপ্নের বাংলাদেশ গড়তে সহায়তায় সফলকাম হবে বিদ্যালয়টি । আল্লাহ আমাদের তৌফিক দিন আমীন।', 'blankavatar.jpg', 'bluetheme', NULL, NULL, NULL);
