(4, 'প্রতিষ্ঠানের নিয়ম শৃঙ্খলা', 'rules', NULL, 1, 0, '<p><strong>ইউনিফর্ম :<strong><br>\r\nছাত্র : কালো প্যান্ট, সাদাশার্ট, ।<br>\r\nছাত্রী : কামিজ নীল, সালোয়ারসাদা, স্কার্ফসাদা, ওড়নাসাদা, বেল্ডসাদা,&nbsp; । <br>\r\nশীতকালে ছাত্র-ছাত্রীদের জন্য নেভী-ব্লু সোয়েটার । <br>                                     \r\n নির্ধারিত পোশাক ও আই.ডি কার্ড সবার জন্য বাধ্যতামূলক ।<br>\r\nমোবাইল, সিমকার্ড, ক্যামেরা, বাইনোকুলার ক্লাশে আনা যাবেনা ।<br>\r\nনির্ধারিত তারিখে  বেতন পরিশোধ করতে হবে ।অন্যথায় বিধি অনুযায়ী জরিমানা দিতে হবে ।<br>\r\nপ্রত্যেক মাসিক, সেমিস্টার,প্রাকনির্বাচনী পরীক্ষার পূর্ব পর্যন্ত মাসিক বেতন, পরীক্ষার ফি সহ সমুদয় বকেয়া পরিশোধ করে প্রবেশ পত্র সংগ্রহ করতে হবে । গ্রুপটিচারের/ক্লাশটিচারের পূর্বানুমতি ছাড়া কোন শিক্ষার্থী ক্লাসে অনুপস্থিত থাকতে পারবেনা। অসুস্থতা বা অনবিার্য কোনো কারণে অননুমোদিত অনুপস্থিতির জন্য পরবর্তী উপস্থিতির দিনেই অভিভাবক এবং গ্রুপটিচার / ক্লাশটিচারের সুপারিশসহ লিখিত দরখাস্ত প্রধান শিক্ষকের নিকট জমা দিতে হবে। অন্যথায় নির্ধারিত হারে জরিমানা দিতে হবে।<br>\r\nবর্ষ-সমাপনী পরীক্ষায় অংশগ্রহন না করলে বা অনুত্তীর্ণ হলে কোনো ক্রমেই পরবর্তী শ্রেণিতে প্রমোশন দেয়া হবে না।<br>\r\nপর-পর দুইটি মাসিক/সেমিস্টার পরীক্ষায় অকৃতকার্য হলে কিংবা কোন পরীক্ষায় নকল করলে প্রতিষ্ঠান থেকে সরাসরি বহিষ্কার করা হবে।<br>\r\nদশম ও দ্বাদশ শ্রেণিতে নির্বাচনী পরীক্ষায় পরপরই পরীক্ষার্থীদের বিশেষ ক্লাস শুরু হবে। উক্ত বিশেষ ক্লাসে উপস্থিত থাকা নির্বাচনী পরীক্ষায় উত্তীর্ণ সকণ শিক্ষার্থীর জন্য বাধ্যতামূলক।<br>\r\nপ্রধান শিক্ষকের /গ্রুপটিচারের/ক্লাশটিচারের অনুমতি ব্যতীত ছুটির পূর্বে কোনোক্রমেই ক্যাম্পাস ত্যাগ করা যাবেনা। শিক্ষার্থীদের সকল প্রকার প্রয়োজন/অভিযোগের কথা সর্বপ্রথম সংশ্লিষ্টটিচার/আবাসিক শিক্ষককে জানাতে হবে।\r\n</strong></strong></p><strong><strong>\r\n<p><strong>জরিমানাবিধি:<strong><br>\r\nক্লাসেঅনুপস্থিতঃ<br>\r\nপ্রতিদিন ক্লাসে অনুপস্থিতির জন্য10/-<br>\r\nক্লাশ থেকে পালানোর জন্য 10/-<br>\r\nমাসিক পরীক্ষায় অনুপস্থিতির জন্য প্রতি বিষয়ে<br>\r\nঅনুত্তীর্ণ হলে প্রতি বিষয়ে ১০০/-<br>\r\nসেমিস্টার পরীক্ষায় অনুপস্থিতি থাকলে প্রতি বিষয়ে\r\nঅনুত্তীর্ণ হলে প্রতি বিষয়ে ১০০/-<br>\r\nকোনো শিক্ষক/কর্মচারীর সংঙ্গে কোনোরূপ অসদাচরণ করলে সর্বোচ্চ শাস্তি স্কুল থেকে বহিষ্কার (জরিমানাপূর্বক)।\r\n কোনো আসবাবপত্র, লাইট, ফ্যান, ইলেকট্রিক যন্ত্রাপাতি বা কোনো কিছুই ক্ষতি করলে ক্ষতিগ্রন্থ জিনিসের মেরামত খরচ বর্তমান মূল্যে আদায় করা হবে । দোষী ব্যক্তিকে সনাক্ত করা সম্ভব না হলে সংশ্লিষ্ট সকল ছাত্র/ছাত্রীদের নিকট থেকে উক্ত জরিমানা আদায় করা হবে।<br>\r\nপরীক্ষা বিষয়ক বিধি;<br>\r\n\r\nপ্রতিটি টিউটোরিয়াল পরীক্ষাতে অংশগ্রহন করতে হবে যুক্তি সঙ্গত কারন ছাড়া পরীক্ষাতে অংশ গ্রহনে ব্যর্থ হলে প্রতিটি পরীক্ষার জন্য ২০ টাকা জরিমানা দিতে হবে ।<br>\r\nসেমিস্টার পরিক্ষায় অংশগ্রহন বাধহতামুলক । উপযুক্ত কারন ব্যতিরেকে সেমিস্টার পরিক্ষায় অনুপস্থিতি অমার্জনীয় বলে গন্য হবে । যুক্তিসঙ্গত কারন ছাড়া পরীক্ষাতে অংশগ্রহনে ব্যর্থ হলে প্রতিটি বিষয়ের জন্য ১০০টাকা করে জরিমানা দিতে হবে ।<br>\r\nসেমিস্টার ও সাপ্তাহিক পরিক্ষা সমুহের ফলাফলের গড় নম্বরই দ্বিতীয় বর্ষে উত্তীর্ণর ভিত্তি রুপে বিবেচিত হবে ।প্রি-টেস্ট ও টেস্ট পরিক্ষায় উত্তীর্ণ শিক্ষার্থীরাই এস.এস.সি।পরীক্ষাতে অংশগ্রহন&nbsp; পাবে ।এ ব্যপারে কোনো সুপারিশ গ্রহনযোগ্য হবেনা।<br>\r\nসেমিস্টার ও টিউটোরিয়াল পরীক্ষাতে প্রতি বিভাগ থেকে ১০% ছাত্র ছাত্রীকে বৃত্তি প্রদানের ব্যবস্থা আছে । <br>\r\n‘Academic Transcript’ প্রণয়ন ও প্রদান ।ছাত্র-ছাত্রিদের শিক্ষার মান উন্নয়ন, আচরণসহ সার্বিক বিষয়ে পর্যবেক্ষণের জন্য প্রত্যেক ছাত্র ছাত্রীকে একজন গাইড টিচার এর নিকট ন্যস্ত করা হবে ।<br>\r\nউত্তীর্ণ ছাত্রছাত্রীদের প্রতি পরীক্ষার ‘Academic Transcript’ অভিভাবকের স্বাক্ষর নিয়ে গাইডের নিকট জমা দিতে হবে ।<br>\r\nঅনুত্তীর্ণ ছাত্রছাত্রিদের অভিভাবক উপস্থিত হয়ে ‘Academic Transcript’ এ স্বাক্ষর করতে হবে ।\r\n</strong></strong></p><strong><strong>\r\n<p><strong>আচরণবিধিঃ</strong><br>\r\n\r\n প্রতিষ্ঠানের কোনো কর্মচারীকে ‘তুই’ বা ‘তুই’ বলে সম্বোধন করা যাবেনা কোন শিক্ষক-কর্মচারীর বিরুদ্ধে কোনো অভিযোগ থাকলে তা  জানাতে হবে ।<br>\r\n প্রতিষ্ঠানের সম্পদের কোনোরূপ ক্ষতি করা যাবেনা ।<br>\r\n প্রতিষ্ঠানের দেয়াল,দরজা, চেয়ার, টেবিল, বেঞ্চ ইত্যাদিতে কোন কিছু লেখা/আঁকা যাবেনা।<br>\r\n মিথ্যা  কথা বলা, পরস্পর অশোভন আচরণ বা ঝগড়া-ঝাটি কিংবা মারামারি করা এবংআইন শৃঙ্খলা পরিপন্থী কোন কাজ করা যাবেনা।<br>\r\n ক্লাস চলাকালে কোন শিক্ষার্থী ক্যাম্পাস বারান্দায় বা অন্যত্র ঘুরাফেরা করতে পারবেনা কিংবা ক্যাম্পাসের বাইরে যেতে পারবেনা।<br>\r\n বাথরুম, টিফিনকেনা, অযু করা ক্লাসরুমে প্রবেশ ও বের হওয়ার সময় পূর্ণ শৃঙ্খলা বজায় রাখতে হবে।ক্যাম্পাসের ভিতর কোনরূপ হৈ- চৈ বা শোর গোল করা যাবেনা।<br>\r\n বিনষ্ট কাগজপত্র, ময়লা/আবর্জনা যেখানে সেখানে ফেলা যাবেনা।<br>\r\n ক্যাম্পাসেকোনপ্রকাররাজনৈতিককার্যকলাপচালানোযাবেনা।\r\n</p></strong></strong></strong></strong>', '2015-06-09', 0, 1, 1),
