(8, 'খেলার মাঠ', 'playground', NULL, 58, 0, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><br><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; টাংগাইল জেলার ঘাটাইল  উপজেলাধীন একাশী  গ্রামে মনোরম পরিবেশে এলাকার গণ্যমান্য ব্যক্তিবর্গের ঐকান্তিক প্রচেষ্ঠায় গড়ে উঠেছিল গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয় সেই থেকে পথ চলা ।বিদ্যালয়টি এই এলাকার মানুষের মাঝে বিদ্যার আলো ছড়িয়ে যাচ্ছে । বিদ্যালয়টি ১৯৬৮ইং সালে মাধ্যমিক বিদ্যালয়ে  উন্নীত হয় ।বর্তমানে স্কুলটিতে প্রায় 500 ছাত্রছাত্রী লেখাপড়া করছে । বিদ্যালয়ে ছাত্র/ছাত্রিদের খেলাধুলা করার জন্য মনোমুগ্ধকর এক বিশাল মাঠ রয়েছে।', '2015-30-07', 0, 1, 1);
