(20, 'পরিচালনা পর্ষদ', 'governing-body', NULL, 2, 0, '<p>কমিটির মেয়াদ :  ১০/০৫/২০১৫ হইতে ০৯/০৫/২০১৭ পর্যন্ত।</p>\r\n<tdশিক্ষক প্রতিনিধি<=\"\" td=\"\">\r\n</tdশিক্ষক><table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n	<td>\r\n		ক্রমিক নং\r\n</td>\r\n	<td>\r\nনাম\r\n</td>\r\n\r\n<td>\r\nপদবী\r\n </td>\r\n <td>\r\n মোবাইল নম্বর\r\n </td>\r\n</tr>\r\n<tr>\r\n<td>০১	</td>					\r\n<td>জনাব মোঃ আবুল কালাম আজাদ</td>\r\n<td>সভাপতি</td>\r\n<td>০১৭৩৪৪০৫৬৩৫</td>\r\n\r\n</tr>\r\n\r\n<tr>\r\n<td>০২</td>			\r\n<td>জনাব মোঃ রফিউল আযম</td>			\r\n<td>শিক্ষক প্রতিনিধি</td>\r\n<td>০১৭১৬৩৪৪১৮০</td>\r\n\r\n</tr>\r\n\r\n<tr>\r\n<td>০৩</td>					\r\n<td> জনাব আঃ মালেক তালুকদার</td>\r\n<td> শিক্ষক প্রতিনিধি</td>\r\n<td>০১৭২৪৩২৬৩০৯</td>\r\n\r\n</tr>\r\n\r\n<tr>\r\n<td>০৪</td>								\r\n<td> জনাবা নাজিয়া সুলতানা</td>\r\n<td>মহিলা শিক্ষক প্রতিনিধি</td>\r\n<td>০১৭২৩৩৫০৫০৯</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>০৫</td>									\r\n<td>জনাব মোঃ রউফ মিয়া</td>\r\n<td>অভিভাবক সদস্য</td>\r\n<td>০১৬২৫৭০৭৭৩৫</td>\r\n\r\n</tr>	\r\n<tr>\r\n<td>০৬</td>									\r\n<td>জনাব মোঃ এনামুল হক সিকদার</td>\r\n<td>অভিভাবক সদস্য</td>\r\n<td>০১৭৭৪৯৭১৭২২</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>০৭</td>									\r\n<td> জনাব মোঃ কাজী জুয়েল </td>\r\n<td>অভিভাবক সদস্য</td>\r\n<td>০১৮৫৯৬৩১৭৪১</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>০৮</td>									\r\n<td>জনাব মোঃ জাহাঙ্গীর আলম</td>\r\n<td>অভিভাবক সদস্য</td>\r\n<td>০১৭৪৫০৪৬০৮৫</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>০৯</td>									\r\n<td>জনাব জেসমিন হাবিব</td>\r\n<td>সংরক্ষিত মহিলা অভিভাবক সদস্য</td>\r\n<td>&nbsp;&nbsp; ০১৭৩২৬৪৮৩৭৪<br></td>\r\n\r\n</tr>\r\n<tr>\r\n<td>১০</td>									\r\n<td>জনাব মোঃ বায়েজিদ হোসেন সিদ্দিকী</td>\r\n<td> প্রতিষ্ঠাতা  সদস্য</td>\r\n<td>০১৭৩৩৯৮০১৬৫</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>১১</td>									\r\n<td> জনাব মোঃ আলী আকবর সিদ্দিকী </td>\r\n<td> দাতা সদস্য</td>\r\n<td>০১৭২৫৩১৩৬৪০</td>\r\n\r\n</tr>\r\n<tr>\r\n<td>১২</td>									\r\n<td>খাজা ফেরদৌস আলম </td>\r\n<td> প্রধান শিক্ষক/সদস্য সচিব</td>\r\n<td>0১৭১৬৭৭৫৩৩৩ / ০১৯১২৬৩৬৯৯৯ </td>\r\n\r\n</tr>\r\n</tbody></table>', '2015-06-09', 1, 1, 1),
(22, 'ফলাফল', 'results', NULL, 22, 22, 'পরীক্ষার নাম-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; সন -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; মোট পরীক্ষার্থী -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; মোট কৃতকার্য - &nbsp; &nbsp; &nbsp;&nbsp; পাশের হার<br><br>যে,এস,সি,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ২০১৬&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ৮৬&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ৮৪&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ৯৭.৬৭<br><br>', '2015-10-08', 0, 1, 1),
(55, 'ইতিহাস', 'history', NULL, 1, 4, 'অতীতে শিক্ষা ছিল গৃহ কেন্দ্রিক। তারপর সভ্যতার আলোক বিকিরনের পথ ধরে শিক্ষা এক উদার অঙ্গনে স্বাচ্ছন্দ্য চিন্তা ও অনুশীলনের সামগ্রী হয়ে উঠেছে। স্কুল প্রতিষ্ঠত হয়েছে সহজ উপায়ে শিক্ষাকে সকলের আয়ত্বে আনার স্বার্থে। গড়ে উঠেছে শান্ত সুন্দর পরিবেশ।কিন্তু এই পরিবেশ এক দিনে গড়ে উঠেনি। এ বিদ্যালয়টি ঘাটাইল উপজেলার প্রাচীনতম বিদ্যালয়। ১৯৬৮ সালে বিদ্যালয়টি উচ্চ বিদ্যালয়ে মজ্ঞুরী লাভ করে।', '1450401420', 0, 1, 1),
(56, 'ছুটির তালিকা', 'leave', NULL, 88, 0, '<p><font size=\"5\">সরকারী/ বেসরকারি মাধ্যমিক ও নিম্নমাধ্যমিক বিদ্যালয় সমুহে ২০১৬ শিক্ষাবর্ষের ছুটির তালিকা\r\n                           ( শুক্রবার ব্যাতিত)</font></p>\r\n<table class=\"dataTable table table-bordered table-striped\">\r\n <tbody>\r\n  <tr>\r\n   <td>ক্রমিক নং</td>\r\n   <td>পর্বের নাম </td>\r\n   <td>তারিখ ও দিন </td>\r\n   <td>দিন সংখ্যা</td>\r\n  </tr>\r\n  <tr>\r\n   <td>০১</td>\r\n   <td>ফাতেহা ই-ইয়াজ দাহাম</td>\r\n   <td>২২ জানুয়ারি,শুক্রবার,২০১৬</td>\r\n   <td>০০ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০2</td>\r\n   <td>শ্রী শ্রী সরস্বতী পূজা<br></td>\r\n   <td>&nbsp;১৩ ফেব্রুয়ারি শনিবার ,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০3</td>\r\n   <td>শহিদ দিবস ও আন্তর্জাতিক মাতৃ ভাষা দিবস<br></td>\r\n   <td>&nbsp;২১ ফেব্রুয়ারি রবিবার,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০4</td>\r\n   <td>&nbsp;মাঘী পূর্ণিমা<br></td>\r\n   <td>২২ ফেব্রুয়ারি,সোমবার,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০5</td>\r\n   <td>&nbsp;শ্রী শ্রী শিবরাত্রী ব্রত<br></td>\r\n   <td>০৭ মার্চ সোমবার,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০6</td>\r\n   <td>&nbsp;জাতির পিতা বঙ্গবন্ধু শেখ মজিবুর রহমান- এর জন্ম দিবস<br></td>\r\n   <td>&nbsp;১৭ মার্চ বৃহস্পতিবার,২০১৬ ,</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০7</td>\r\n   <td>&nbsp;শুভ দোলযাত্রা<br></td>\r\n   <td>&nbsp;২৩ মার্চ বুধবার,২০১৬</td>\r\n   <td>০১দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০8</td>\r\n   <td>স্বাধীনতা ও জাতীয় দিবস<br></td>\r\n   <td>২৬ মার্চ ,শনিবার,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>০9</td>\r\n   <td>&nbsp;ইস্টার সানডে<br></td>\r\n   <td>২৭ মার্চ, রবিবার,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>১0</td>\r\n   <td>বৈসাবি<br></td>\r\n   <td>১২ এপ্রিল মঙ্গলবার,২০১৬</td>\r\n   <td>০১ দিন<br></td>\r\n  </tr>\r\n  <tr>\r\n   <td>11</td>\r\n   <td>&nbsp;বাংলা নববর্ষ<br></td>\r\n 