(59, 'প্রতিষ্ঠাতার ইতিহাস', 'founder-history', NULL, 1, 0, 'অতীতে&nbsp; শিক্ষা ছিল গৃহ কেন্দ্রিক। তারপর সভ্যতার আলোক বিকিরনের পথ ধরে শিক্ষা এক উদার অঙ্গনে স্বাচ্ছন্দ্য চিন্তা ও অনুশীলনের সামগ্রী হয়ে উঠেছে। স্কুল প্রতিষ্ঠিত হয়েছে সহজ উপায়ে, শিক্ষাকে সকলের আয়ত্বে আনার স্বার্থে। গড়ে উঠেছে শান্ত সুন্দর পরিবেশ।কিন্ত, এই পরিবেশ এক দিনে গড়ে উঠেনি। এ বিদ্যালয়টি ঘাটাইল উপজেলার প্রাচীনতম বিদ্যালয়। ১৯৬৮ সালে এলাকার কতিপয় লোকের ঐকান্তিক প্রচেষ্টায় ও ত্যাগের ফলে প্রতিষ্ঠা লাভ করে বিদ্যালয়টি এবং ১৯৭১ সালে উচ্চ বিদ্যালয়ে মজ্ঞুরী লাভ করে। এলাকার তদানিন্তন ধনাঢ্য ব্যাক্তি জনাব ওছমান গনি সাহেব জমি,টাকা ও টিনের ঘর দান করলেন স্কুলের জন্য। তার দানকে সম্মান দেখিয়ে তার নামে নামকরন করা হয় স্কুলটির। তার উচ্চশিক্ষিত ছেলে জনাব বায়েজিদ হোসেন সিদ্দিকী সাহেব হলেন প্রথম প্রধান শিক্ষক।<br>', '1450934753', 0, 1, 1);
