(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 88, 88, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  বিসমিল্লাহির রাহমানির রাহিম।<br>&nbsp;\r\n   <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <br><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; টাঙ্গাইল জেলার ঘাটাইল উপজেলার অন্তর্গত গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয়টি নিরেট অজপাড়াগাঁয়ে অবস্থিত একটি ঐতিহ্যবাহী বিদ্যালয়।তদানীন্তন শিক্ষা বিবর্জিত এলাকায় শিক্ষা বিস্তারের প্রয়োজনে এলাকার কতিপয় সচেতন মানুষের চেষ্টার ফসল এই বিদ্যালয় । ১৯৬৮ সালে প্রতিষ্ঠিত হয়ে অদ্যাবধি ছড়িয়ে যাচ্ছে বিদ্যার আলো। বর্তমান যুগ আধুনিক সভ্যতার যুগ , তথা কম্পিউটার যুগ। আধুনিক সভ্যতার সাথে তাল মিলিয়ে কম্পিউটারের ব্যবহার চলছে এ বিদ্যালয়েও। অতীত ঐতিহ্যকে ধারন করে , নতুন সভ্যতার আলো ছড়িয়ে ডিজিটাল বাংলাদেশ তথা স্বপ্নের বাংলাদেশ গড়তে সহায়তা্য সফলকাম হবে এ বিদ্যালয়টি। আল্লাহ আমাদের তৌফিক দিন। আমীন। <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;মোহাম্মদ নুরুজ্জামান<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ভারপ্রাপ্ত) প্রধান শিক্ষক,<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয়।<br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>', '1450938847', 0, 1, 1),
(62, 'প্রাক্তন শিক্ষকদের তালিকা', 'xteacher', NULL, 2, 0, '&nbsp;প্রাক্তন শিক্ষকদের তালিকাঃ-<br>১। জনাব মোঃ হাবিবুর রহমান&nbsp; - ভাঃপ্রঃশিঃ<br>২। জনাব মোঃ হযরত আলী&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - সহঃ শিঃ<br>৩। জনাব মোঃ আব্দুল কুদ্দুস খান- সহঃ শিঃ<br>৪। জনাব মোঃ মহি উদ্দিন&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - সহঃ প্রঃ শিঃ<br>৫। বাবু প্রমথ চন্দ্র বিশ্বাস&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - সহঃ শিঃ<br>৬। জনাব মোঃ আবুল কাশেম তাং - সহঃ শিঃ<br>৭। জনাব তানজিলা ইসলাম&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - সহঃ শিঃ<br>৮। জনাব মোঃ আলী আকবর সিদ্দিকী- অফিস সহঃ<br>৯। জনাব মোঃ বদিউজ্জামান তাং&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - অফিস সহঃ<br>', '1450940075', 0, 1, 1),
(63, 'কর্মচারীদের  তালিকা ', 'staffs', NULL, 2, 0, 'কর্মচারীদের তালিকাঃ-<br>১। মোঃ বুলবুল সিকদার -করণিক কাম কমপিউটার অপারেটর<br>২। মোঃ ওয়াজেদ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - এম,এল,এস,এস,<br>৩। মোঃ আতিকুর&nbsp; রহমান লিটন - এম,এল,এস,এস,<br>', '1450940199', 1, 1, 1),
(64, 'শুন্যপদের তথ্য', 'vacancy', NULL, 57, 0, '<p>শুন্য পদের তথ্য</p>\r\n<table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n<td>পদের নাম &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br><br></td>\r\n<td>ন্যূনতম যোগ্যতা</td>\r\n<td>আসন সংখ্যা</td>\r\n</tr>\r\n<tr>\r\n<td>সহকারি গ্রন্থাগারিক &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n<td>সরকার অনুমোদিত বিশ্ববিদ্যালয় হইতে<br>\r\nগ্রন্থাগারিক এ ডিপ্লোমা সার্টিফিকেটধারী। &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n<td>০১</td>\r\n</tr>\r\n</tbody>\r\n</table> ', '1450937563', 0, 1, 1),
(65, 'ইউনিফরম ও বেতন কাঠামো', 'Uniformsstructure', NULL, 57, 0, '<h3></h3>\r\n<table class=\"table table-bordered\">\r\n\r\n<tbody>\r\n<tr>\r\n <td>শ্রেণি</td>\r\n <td>ভর্তি ফি</td>\r\n <td>সেশন চার্চ</td>\r\n <td>মাসিক বেতন</td>\r\n</tr>\r\n<tr>\r\n	<td>৬ষ্ঠ</td>\r\n	<td>১০০</td>\r\n	<td>৫০০</td>\r\n	<td>১০০</td>\r\n</tr>\r\n<tr>\r\n	<td>৭ম</td>\r\n	<td>১১০</td>\r\n	<td>৫০০</td>\r\n	<td>১০০</td>\r\n</tr>\r\n<tr>\r\n	<td>৮ম</td>\r\n	<td>১৫০</td>\r\n	<td>৫০০</td>\r\n	<td>১০০</td>\r\n</tr>\r\n<tr>\r\n	<td>৯ম</td>\r\n	<td>১৫০</td>\r\n	<td>৫০০</td>\r\n	<td>১০০</td>\r\n</tr>\r\n<tr>\r\n	<td>১০ম</td>\r\n	<td>১০০</td>\r\n	<td>৫০০</td>\r\n	<td>১০০</td>\r\n</tr>\r\n\r\n</tbody>\r\n</table>', '1450939545', 0, 1, 1),
(66, 'ভৌত অবকাঠামো', 'Infrastructure', NULL, 57, 0, '<p>অত্র বিদ্যালয়টি ভৌতঅবকাঠামোগতদিক থেকে পরিপূর্ন নাহলেও নেহাৎ মন্দ নয়।এই বিদ্যালয়ে ০৩ টি দ্বি-তল ভবন , ০১টি একতলা ভবন পাকা বিল্ডিং ও ০১ টি টিনশেড বিল্ডিং রহিয়াছে।<br>\r\n১। ভূমি :<br>\r\n   </p><ul>\r\n  <li>(ক) বিদ্যালয় গৃহ-   ০৬৭ শতক </li>                                                            \r\n    <li>(খ) খেলার মাঠ -    ০৯৮ শতক </li>                                                         \r\n    <li>(গ) আবাদযোগ্য-    ০৯১.৫ শতক  </li>                                                     \r\n   <li> (ঘ) পুকুর        -    ০১৮ শতক    </li>                                             \r\n      <li> সর্বমোট=           ২৭৪.৫ শতক   </li>    \r\n</ul>                                                   \r\n ২। পাকা বিল্ডিং  -    ১০৬৪৩ বর্গফুট ( দ্বি-তল ভবন ৩টি )<br>&nbsp;৩। লাইব্রেরীর কক্ষ-০১টি ৩০ফুটX২৫ফুট, পুস্তক সংখ্যা- ১৬৩৮ টি   <br>                                                     \r\n ৪। কম্পিউটার -   ৪টি    <br>                                                             \r\n ৫। প্রিণ্টার -  ১টি  <br>                                                                 \r\n ৬। প্রজেক্টর -   ১টি  <br>                                                          \r\n ৭। চেয়ার - ৩০টি <br>                                                                  \r\n ৮।  টেবিল- ১২টি <br>                                                                 \r\n ৯। লেকচার টেবিল - ৫টি  <br>                                                           \r\n ১০। ব্ল্যাক বোর্ড - ১০টি <br>                                                               \r\n ১১। বেঞ্চ - ১২০ জোড়া <br>                                                              \r\n ১২। টেষ্ট টিউব - ৬০টি   <br>                                                         \r\n ১৩। স্কেল 		১০টি    <br>                                                          \r\n ১৪। অনুবক্ষিন যন্ত্র – ০৫ টী   <br>                                                       \r\n ১৫। ষ্টিল আলমারী - ৪টি  <br>                                               \r\n  ১৬। কাঠের আলমারী - ৩টি  <br>                                                    \r\n১৭। দেরাজ - ২টি      <br>                                                \r\n১৮। সেল্ ফ্ - ২টি     <br>                                                \r\n১৯। গ্লোব, চার্ট , ম্যাপ ইত্যাদি।   <br>                                            \r\n ২০। টিউব ওয়েল&nbsp; ৩টা। <br>                                                             \r\n ২১। মসজিদ গৃহ  ।<br>২২। বুক সেলফ ০৩ টি।<br>২৩। লাইব্রেরী পড়ার টেবিল - ০৩ টি।<br>২৪। ইলেকট্রিক ফ্যান&nbsp;&nbsp; -&nbsp; ৪০ টি।<br>২৫। ল্যাপটপ-&nbsp;&nbsp; ০১ টি।<br><br><p></p>', '1450938527', 0, 1, 1),
(67, 'সংবাদ', 'latestnews', NULL, 0, 67, 'গৌরাঙ্গী-একাশী ওছমানীয়া উচ্চ বিদ্যালয়, ঘাটাইল, টাঙ্গাইল-এ ৬ষ্ঠ শ্রেণী হইতে ৯ম শ্রেণী পর্যন্ত ভর্তির ফর্ম বিতরণ করা হইতেছে। আগামী ০৩/০১/২০১৭ তারিখ ভর্তি পরীক্ষা সকাল ১১-০০ ঘটিকায় বিদ্যালয়ে অনুষ্ঠিত হইবে।<br>', '1450937928', 1, 1, 1),
