..........ইং সালের বার্ষিক পরী।ক্ষায়..........শ্রেনী হইতে ............শ্রেনীতে\r\nউত্তীর্ন হইয়াছে। ভর্তি বহি অনুযায়ী তাহার জন্ম তারিখ..................।<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"mso-tab-count:1\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>অত্র\r\nবিদ্যালয়ে অধ্যয়নকালীন সময়ে তাহাকে বিদ্যালয় ও রাষ্ট্রীয় শৃংখলার পরিপন্থি কোন কাজে\r\nঅংশগ্রহন করিতে দেখা যায় নাই। আমার জানামতে তাহার চরিত্র ও আচরণ ভাল।</span><span style=\"font-size:14.0pt;mso-bidi-language:BN\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:1.35pt;\r\nmargin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:left;\r\ntab-stops:118.35pt center 261.65pt\" align=\"left\"><span style=\"font-size:14.0pt;mso-bidi-language:\r\nBN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:1.35pt;margin-bottom:\r\n0in;margin-left:0in;margin-bottom:.0001pt;tab-stops:118.35pt center 261.65pt\"><span style=\"font-size:14.0pt;font-family:&quot;Vrinda&quot;,&quot;sans-serif&quot;;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Vrinda;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:BN\" lang=\"BN\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; আমি তাহার সার্বিক মঙ্গল ও উজ্জ্বল ভবিষ্যত\r\nকামনা করি।</span><span style=\"font-size:14.0pt;mso-bidi-language:BN\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:1.35pt;\r\nmargin-bottom:0in;margin-left:0in;margin-bottom:.000