(84, 'মাল্টিমিডিয়া ক্লাসরুম', 'multimedia-classroom', NULL, 58, 0, 'গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয় সেই থেকে পথচলা। বিদ্যালয়টি এই এলাকার মানুষের মাঝে বিদ্যার আলো ছড়িয়ে যাচ্ছে।\r\nবিদ্যালয়ে ছাত্র/ছাত্রীদের উন্নত ও আধুনিক ডিজিটাল শিক্ষা দানের জন্য মাল্টিমিডিয়া ক্লাসরুম চালু করা হয়েছে এবং প্রশিক্ষণ প্রাপ্ত শিক্ষক্মণ্ডলী স্লাইড তৈরী করে সকল শ্রেণীতে শিক্ষার্থীদের নিয়মিত আকর্ষনীয় পাঠদান করে থাকেন।<br>', '1450942510', 0, 1, 1),
(85, 'আইসিটি ল্যাব', 'ICT-Lab', NULL, 58, 0, '&nbsp;&nbsp; গৌরাঙ্গী একাশী ওছমানীয়া উচ্চ বিদ্যালয়টি ১৯৬৮ সালে প্রতিষ্ঠা লাভ করে অদ্যাবধি সুনামের সাথে এই এলাকার মানুষের মাঝে বিদ্যার আলো ছড়িয়ে যাচ্ছে।সভ্যতার বিকাশ ও বিজ্ঞ্যানের অবদানের সাথে তাল মিলিয়ে\r\nআধুনিক ও তথ্য যোগাযোগ প্রযুক্তির সঠিক ব্যবহার যাতে  ছাত্র/ছাত্রীরা শিখতে পারে সে জন্য আইসিটি ল্যাব তৈরি করা রয়েছে পঞ্চবার্ষিক পরকিল্পনাধীন।\r\n', '1450942571', 0, 1, 1),
(86, 'কম্পিউটার ব্যবহার সংক্রান্ত তথ্য', 'information-of-computers-useing', NULL, 58, 0, '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; প্রতিদিন কম্পিউটার ব্যাবহার -- কমপক্ষে ০৪ ঘন্টা।<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; প্রতিদিন মাল্টিমিডিয়া ক্লাশ&nbsp; --- কমপক্ষে ০৩ টা।<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; কম্পিউটার ব্যাবহারকারী শিক্ষক সঙ্খ্যা - ০৮ জন।<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; কম্পপিউটার ব্যাবহারকারী করমচারী - ০১ জন।<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বিদ্যালয়ের প্রয়োজনীয় কম্পিউটার কম্পোজের&nbsp; সকল কাজ বিদ্যালয়েই করা হয়।<br><br>', '1450941612', 0, 1, 1),
(87, 'মসজিদ', 'mosque', NULL, 58, 0, '<br><br>&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বিদ্যালয়ের শিক্ষক-শিক্ষার্থী-কর্মচারী সহ এলাকাবাসীর নিয়মিত নামাজ আদায়ের জন্য বিদ্যালয় সংলগ্ন একটি পাকা মসজিদ তৈরী করা হয়েছে যেখানে নিয়মিত জামাতের সাথে প্রতিদিন পাঁচ ওয়াক্ত&nbsp; নামাজ আদায় হয়।<br>', '1450942573', 0, 1, 1),
